import React from "react";

export default function index() {
  return (
    <footer>
      <div className="container">
        <div className="sd-footer-head">
          <h2>Trường Đại Học Cần Thơ</h2>
          <h3>Khoa Công Nghệ Thông Tin & Truyền Thông</h3>
        </div>
      </div>
    </footer>
  );
}
